import {GoogleDownload} from './components/GoogleDownload/index'
import './App.css';

const data = [
  ["Item", "Cost", "Stocked", "Ship Date"],
  ["Wheel", "$20.50", "4", "3/1/2016"],
  ["Door", "$15", "2", "3/15/2016"],
  ["Engine", "$100", "1", "3/20/2016"],
  ["Totals", "=SUM(B2:B4)", "=SUM(C2:C4)", "=MAX(D2:D4)"]
]

function App() {
  return (
    <div className="App">  

      <GoogleDownload data={data}/>
    </div>
  );
}

export default App;
